import { Menu, Avatar } from 'antd';
import { UserOutlined, MailOutlined, PoweroffOutlined, SettingOutlined, FileTextOutlined, CalendarOutlined } from '@ant-design/icons';
import { useNavigate } from 'react-router-dom';
import Header from '../common/header';
import Calend from '../components/calendar';

const { SubMenu } = Menu;

const items = [
    {
        label: "Görevler",
        key: 'task',
        icon: <FileTextOutlined />
    },
    {
        label: "Takvim",
        key: 'calendar',
        icon: <CalendarOutlined />
    },
    {
        label: 'Mail',
        key: 'mail',
        icon: <MailOutlined />,
    },
    {
        key: 'app',
        avatar: <Avatar size={35} icon={<UserOutlined />} />,
        children: [
            {
                label: 'Profil Düzenle',
                key: 'setting:1',
                icon: <SettingOutlined />,
            },

        ],
    },
];

const Home = () => {


    return (
        <>
            <Header itemsList={items}></Header>

            <Calend></Calend>


        </>


    );
};

export default Home;
